import React from "react";
import MvEmail from "../generalLayout/mvEmail";
import Motor3d from "../generalLayout/motor3d";
import PageName from "../generalLayout/pageName";
import { ScrollNavFunction } from "../generalFunctionForOnScroll/ScrollEventFor_MotorPage";
import { FooterGe } from "../generalLayout/footer_test";
import MotorPageHeader from "../generalLayout/motorPageHeader";
import { NavWhiteCompact } from "../generalFunctionForOnScroll/ScrollEventFor_Homepage";
import Nav from "../generalLayout/nav";
import NavDesktop from "../generalLayout/navDesk";
const namePage = "Brutale 1000 RR";

const heroGradientStart = "#A4191B";
const heroGradientEnd = "#6B0B0D";
const brutale1000rr_infor = {
  namePage: "Brutale 1000 RR",
  price: "31.500",
  nameHeaderTitle: "brutale1000rr/brutale-1000-rr.svg",
  bgHeaderParallax: "brutale1000rr/brutale-1000-rr-xl.webp",
  manifesto_Arr: ["THE", "ALL-OUT", "HYPER", "NAKED"],
  colorBg: `linear-gradient(90deg,${heroGradientStart} 0%,${heroGradientEnd} 100%)`,
  contentHeaderContent:
    "F1-derived technology for out-of-this-world performance, and the first fully connected bike you can control through the MVRide app.",
  Model3ds: [
    {
      link: "brutale1000rr/original/1000rr",
      color:
        "linear-gradient(45deg, rgba(45,0,12,1) 25%, rgba(121,9,9,1) 50%, rgba(255,0,0,1) 100%)",
      nameOfColor: "AGO RED DARK METALLIC MATT GREY",
    },
    {
      link: "brutale1000rr/greenMetal/brutale1000rr",
      color:
        "linear-gradient(45deg, rgba(0,0,0,1) 25%, rgba(56,56,56,1) 60%, rgba(148,148,148,1) 100%)",
      nameOfColor: "FLUO YELLOW METALLIC AVIO GRAY",
    },
  ],
};

export default function BodyBrutale1000RR() {
  window.addEventListener("scroll", () => {
    ScrollNavFunction();
    NavWhiteCompact();
  });
  return (
    <>
      <div
        className="nav-pc-homepage"
        style={{
          height: "84px",
          width: "100vw",
          background: brutale1000rr_infor.colorBg,
        }}
      ></div>
      <NavDesktop />
      <Nav color="white" />
      <MotorPageHeader
        manifesto_Arr={brutale1000rr_infor.manifesto_Arr}
        nameHeaderTitle={brutale1000rr_infor.nameHeaderTitle}
        titleSize="auto 21%"
        colorBg={brutale1000rr_infor.colorBg}
        contentHeaderContent={brutale1000rr_infor.contentHeaderContent}
        price={brutale1000rr_infor.price}
        bgHeaderParallax={brutale1000rr_infor.bgHeaderParallax}
        reveredContent={false}
        heightContentTop="13%"
      />
      <PageName namePage={brutale1000rr_infor.namePage} />
      <Motor3d models={brutale1000rr_infor.Model3ds} />
      <MvEmail></MvEmail>
      <br />
      <FooterGe />
    </>
  );
}
